"""## Average Meter
It is a simple class for keeping training statistics, such as losses and accuracies etc. The `.val` field usually holds the statistics for the current batch, whereas the `.avg` field hold statistics for the current epoch.
"""

class AverageMeter(object):
    """Computes and stores the average and current value"""
    def __init__(self):
        self.reset()

    def reset(self):
        self.val = 0
        self.avg = 0
        self.sum = 0
        self.count = 0

    def update(self, val, n=1):
        self.val = val
        self.sum += val * n
        self.count += n
        self.avg = self.sum / self.count

"""## Train and Test Functions"""

from tqdm.notebook import tqdm
import torch.nn.functional as F
from sklearn.metrics import confusion_matrix
import matplotlib.pyplot as plt

## Define train function
def train(model, device, train_loader, optimizer):
    # Meter
    loss = AverageMeter()
    # Switch to train mode
    model.train()
    tk0 = tqdm(train_loader, total=int(len(train_loader)))
    for batch_idx, (data, target) in enumerate(tk0):
        # After fetching the data, transfer the model to the required device
        data, target = data.to(device), target.to(device)
        # Compute the forward pass
        output = model(data)
        # Compute the loss function
        loss_this = F.cross_entropy(output, target)
        # Initialize the optimizer
        optimizer.zero_grad()
        # Compute the backward pass
        loss_this.backward()
        # Update the parameters
        optimizer.step()
        # Update the loss meter
        loss.update(loss_this.item(), target.shape[0])
    print('Train: Average loss: {:.4f}\n'.format(loss.avg))
    return loss.avg
        
## Define test function
def test(model, device, test_loader):
    # Meters
    loss = AverageMeter()
    acc_top1 = AverageMeter()
    acc_top5 = AverageMeter()
    # Switch to eval mode
    model.eval()
    with torch.no_grad():
        for data, target in test_loader:
            # Transfer the model to the required device
            data, target = data.to(device), target.to(device)
            # Perform a forward pass
            output = model(data)
            # Compute the loss function
            loss_this = F.cross_entropy(output, target)
            # Get the top-1 and top-5 predictions
            _, pred_top1 = output.topk(1, dim=1)
            _, pred_top5 = output.topk(5, dim=1)
            # Update the loss and accuracy meters
            loss.update(loss_this.item(), target.size(0))
            acc_top1.update((pred_top1 == target.unsqueeze(1)).sum().item(), target.size(0))
            acc_top5.update((pred_top5 == target.unsqueeze(1)).sum().item(), target.size(0))
    # Compute accuracies
    top1_accuracy = acc_top1.avg / len(test_loader.dataset)
    top5_accuracy = acc_top5.avg / len(test_loader.dataset)
    print('Test: Average loss: {:.4f}, Top-1 Accuracy: {:.2f}%, Top-5 Accuracy: {:.2f}%\n'.format(
        loss.avg, top1_accuracy * 100, top5_accuracy * 100))
    return top1_accuracy, top5_accuracy

