def visualize_feature_maps(model, device, data_loader, chosen_layer):
    # Choose a random image from the data loader
    data, _ = next(iter(data_loader))
    data = data.to(device)
    
    # Move the model to the eval mode
    model.eval()
    
    # Get the feature maps from the chosen layer
